import * as React from 'react';

export interface Props {
    heading?: string;
    className?: string;
}

export default function Heading({ heading, className }: Props) {
    const style ={
        color:'#fff',
        fontSize:45,
        fontWeight:600,
    }
    return (
        <h2 style={style} className={className}>{heading}</h2>
    );
}
